-- Procedure structure for Anular_ordenservicio
-- ----------------------------
DROP PROCEDURE IF EXISTS `Anular_ordenservicio`;
delimiter ;;
CREATE PROCEDURE `Anular_ordenservicio`(codigo int(11))
BEGIN
	#Routine body goes here...
	
	update ordenservicio set estado = 0 where idorden = codigo;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Buscarordenservicio
-- ----------------------------
DROP PROCEDURE IF EXISTS `Buscarordenservicio`;
delimiter ;;
CREATE PROCEDURE `Buscarordenservicio`(nombre varchar(255), apellidos varchar(255))
BEGIN
	
	SELECT
	os.idorden as CODIGO,
	CONCAT(c.nombre,' ',c.apellidos) as CLIENTE,
	os.estadoservicio AS ESTADOSERVICIO,
	os.fecha_inicioservicio AS FECHA_INICIO,
	os.fecha_finalservicio AS FECHA_FINAL,
	os.garantia AS GARANTIA,
	os.desc_producto AS DESCRIPCION_PRODUCTO,
	os.observaciones AS OBSERVACIONES,
	os.diagnostico AS DIAGNOSTICO,
	os.tipo_pago AS TIPO_PAGO,
	os.importe_total AS IMPORTE_TOTAL,
	os.pago AS PAGO,
	os.vuelto AS VUELTO,
	os.saldo AS SALDO,
	(select case os.estado when 1 then "ACTIVO" when 0 then "INACTIVO" end)as ESTADO
	FROM ordenservicio os 
	inner join cliente c on c.idcliente = os.idcliente
	
	where c.nombre = nombre or c.apellidos = apellidos
		order by os.idorden desc;



END
;;
delimiter ;

