delimiter ;;
CREATE PROCEDURE `Listaproductocategoria`(ncategoria varchar(50))
BEGIN
	#Routine body goes here...
	select
	p.idarticulo as CODIGO,
	p.imagen as IMAGEN ,
	p.nombre AS NOMBRE,
	p.marca AS MARCA,
	p.descripcion AS DESCC,
	p.precioventa AS PRECIO_VENTA,
		P.existencias as STOK
		 from productos p
inner join categoria c on p.idcategoria = c.idcategoria
where c.nombre = ncategoria and existencias > 1;


END
;;
