-- ----------------------------
-- Procedure structure for Listar_ordenes_pendientes
-- ----------------------------
DROP PROCEDURE IF EXISTS `Listar_ordenes_pendientes`;
delimiter ;;
CREATE PROCEDURE `Listar_ordenes_pendientes`()
BEGIN
	
	SELECT
	os.idorden as CODIGO,
	CONCAT(c.nombre,' ',c.apellidos) as CLIENTE,
	os.estadoservicio AS ESTADOSERVICIO,
	os.fecha_inicioservicio AS FECHA_INICIO,
	os.fecha_finalservicio AS FECHA_FINAL,
	os.garantia AS GARANTIA,
	os.desc_producto AS DESCRIPCION_PRODUCTO,
	os.observaciones AS OBSERVACIONES,
	os.diagnostico AS DIAGNOSTICO,
	os.tipo_pago AS TIPO_PAGO,
	os.importe_total AS IMPORTE_TOTAL,
	os.pago AS PAGO,
	os.vuelto AS VUELTO,
	os.saldo AS SALDO,
	(select case os.estado when 1 then "ACTIVO" when 0 then "INACTIVO" end)as ESTADO
	FROM ordenservicio os 
	inner join cliente c on c.idcliente = os.idcliente 
	where os.estadoservicio="ABIERTO" or os.estadoservicio="EN CURSO" and os.estado = 1 
		order by os.idorden desc;
	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Listar_ordenservicio
-- ----------------------------
DROP PROCEDURE IF EXISTS `Listar_ordenservicio`;
delimiter ;;
CREATE PROCEDURE `Listar_ordenservicio`()
BEGIN
	
	SELECT  
	os.idorden as CODIGO,
	CONCAT(c.nombre,' ',c.apellidos) as CLIENTE,
	os.estadoservicio AS ESTADOSERVICIO,
	os.fecha_inicioservicio AS FECHA_INICIO,
	os.fecha_finalservicio AS FECHA_FINAL,
	os.garantia AS GARANTIA,
	os.desc_producto AS DESCRIPCION_PRODUCTO,
	os.observaciones AS OBSERVACIONES,
	os.diagnostico AS DIAGNOSTICO,
	os.tipo_pago AS TIPO_PAGO,
	os.importe_total AS IMPORTE_TOTAL,
	os.pago AS PAGO,
	os.vuelto AS VUELTO,
	os.saldo AS SALDO,
	(select case os.estado when 1 then "ACTIVO" when 0 then "INACTIVO" end)as ESTADO
	FROM ordenservicio os 
	inner join cliente c on c.idcliente = os.idcliente where os.estado = 1 
		order by os.idorden desc;

END
;;
