delimiter ;;
CREATE PROCEDURE `NewProc`(nombre varchar(255), apellidos varchar(255))
BEGIN
	
	SELECT  CONCAT(c.nombre,' ',c.apellidos),os.estadoservicio,os.fecha_inicioservicio,os.fecha_finalservicio
,os.garantia,os.desc_producto,os.observaciones,os.diagnostico,os.tipo_pago,os.importe_total,os.pago,os.vuelto,os.saldo,os.estado
FROM ordenservicio os 
inner join cliente c on c.idcliente = os.idcliente 
where c.nombre = nombre or c.apellidos = apellidos;


END
;;
