-- ----------------------------
-- Triggers structure for table detalle_compra
-- ----------------------------
DROP TRIGGER IF EXISTS `id_compra`;
delimiter ;;
CREATE TRIGGER `id_compra` AFTER INSERT ON `detalle_compra` FOR EACH ROW BEGIN
          update productos 
                               set existencias  = existencias + NEW.cantidad
                               where idarticulo = NEW.id_producto;              
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table detalle_os_productos
-- ----------------------------
DROP TRIGGER IF EXISTS `controlstokservicioproduct`;
delimiter ;;
CREATE TRIGGER `controlstokservicioproduct` AFTER INSERT ON `detalle_os_productos` FOR EACH ROW BEGIN
          update productos 
                               set existencias  = existencias - NEW.cantidad
                               where idarticulo = NEW.id_producto;              
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table detalle_venta
-- ----------------------------
DROP TRIGGER IF EXISTS `controlstokproducto`;
delimiter ;;
CREATE TRIGGER `controlstokproducto` AFTER INSERT ON `detalle_venta` FOR EACH ROW BEGIN
          update productos 
                               set existencias  = existencias - NEW.cantidad
                               where idarticulo = NEW.idproducto;              
END
;;
delimiter ;

